import React from 'react'
import './Title.css'

function Title() {
    return (
        <div className='Title'>
            <h1>SFPOPOS</h1>
            <div className="Title-Subtitle">San Franciscos Privately Owned Public Spaces</div>
            <img src='bitcoin.png' alt='bitcoin' width='80px'></img>
        </div>
    )
}

export default Title
